window.bookSummaryJSON = "<p>Join James, our intrepid adventurer, streamer, and bug hunter, as he jumps headfirst into the first true immersion VRMMORPG game and explores the digital reality that the dev's have kept under lock and key.</p> <p>No previews? No class or race info before launch? What could possibly go wrong? Especially starting in the empire inspired by ancient Egypt.</p> <p>Rolling a character reminiscent of an old-school <i>D&amp;D</i> cleric, James takes on the world of <i>Sosaku Online</i> with spear, shield, and holy fire.</p> <p>Features: VR, cursing, violence, slice of life. No: harem, explicit, telemarketers.</p>"; 
